module.exports = async d => {
  
  const code = d.command.code
  
  const r = code.split("$serverChannelExists").length - 1
  
  const inside = code.split("$serverChannelExists[")[r].split("]")[0]
  
  const channel = d.message.guild.channels.cache.get(inside) 
  
  return {
    code: code.replaceLast(`$serverChannelExists[${inside}]`, channel ? true : false) 
  } 
}

